import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './styles.css';
import Power from './components/Power';
import Comms from './components/Comms';
import Drivetrain from './components/Drivetrain';
import Cam from './components/Cam';

const App = () => {
  return (
    <div className="container mt-4" style={{ backgroundColor: 'black', color: 'white' }}>
      <div className="row">
        <div className="col-md-6">
          <div className="row">
            <div className="col">
              <Power/>
            </div>
          </div>
          <div className="row">
            <div className="col">
              <Comms/>
            </div>
          </div>
          <div className="row">
            <div className="col">
              <Drivetrain/>
            </div>
          </div>
        </div>
        <div className="col-md-6">
          <Cam cameraNumber={1}/> 
          <Cam cameraNumber={2}/> 
        </div>
      </div>
    </div>
  );
};

export default App;
